import React from 'react'
import { useNavigate } from "react-router-dom"

const LandingPage = () => {
  const navigate = useNavigate();

  return (
    <div>
      <h1>Landing Page</h1>
      <h3>CS 415 Website</h3>
      <p style="color:white;">This is the publicly accessible page for all users to see</p>
    </div>
  )
}

export default LandingPage
